An '''eclectic impling jar''' is the result of successfully catching an [[eclectic impling]] in the [[Impetuous Impulses]] [[Minigames|minigame]].

This jar can be traded in singularly to [[Elnock Inquisitor]] for 3 empty impling jars, but this is not recommended due to its high value.

You can trade two of this jar, three [[essence impling jar]]s and one [[nature impling jar]] for a [[jar generator]].

==Loot==
At current [[Grand Exchange]] prices, opening an eclectic impling jar gives {{Coins|{{ImpValue|eclectic|jar=yes}} round 0}} worth of loot, on average. This means opening eclectic impling jars marks an average profit of {{Coins|{{ImpValue|eclectic|jar=yes}}-{{GEP|Eclectic impling jar}} round 0}} per jar, however this does not include loot from clue scrolls.

On average, one would profit {{Coins|25*({{ImpValue|eclectic|jar=yes}}-{{GEP|Eclectic impling jar}}) round 0}} to get a [[clue scroll (medium)|medium clue scroll]] from eclectic impling jars at current [[Grand Exchange]] prices, excluding the rewards from the completed [[Treasure Trail]]s.

